package com.wavesplatform.it.sync.smartcontract

import com.wavesplatform.it.api.SyncHttpApi._
import com.wavesplatform.it.transactions.BaseTransactionSuite
import org.scalatest.CancelAfterFailure

class ScriptUtilsTestSuite extends BaseTransactionSuite with CancelAfterFailure {
  test("decompile script containing deep block structure should not blow stack") {
    val node = nodes.head

    val blockCount = 1213
    val separator  = " " * 4
    val scriptText =
      s"""{-# STDLIB_VERSION 3 #-}
         |{-# CONTENT_TYPE EXPRESSION #-}
         |let bytes = base58'AAAAAAAAAAAAAA'
         |let sig = base58'AAAAAAAAAAAAAA'
         |let pbk = base58'AAAAAAAAAAAAAA'
         |${"if (" * (blockCount + 1)}sigVerify(bytes, sig, pbk))
         |${s"${separator}then sigVerify(bytes, sig, pbk)\n${separator}else false)\n" * blockCount}${separator}then sigVerify(bytes, sig, pbk)
         |${separator}else false""".stripMargin

    val compiledScript =
      ""

    node.scriptDecompile(compiledScript).script shouldBe scriptText
  }
}
